import React, {useState} from 'react';

let Todo_data = [
  "顔を洗う",
  "朝ごはんを食べる",
  "歯磨きをする",
];

export const Todo_list = () => {
  return(
    <div>
      <ul>
        {
          Todo_data.map((todo, i) => {
            return (
              <li key={i}>{todo}</li>
            )
          })
        }
      </ul>

    </div>
  )
}
